package Day4Assignment;
//print odd number 521 to 229 using while
public class OddNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i=521;
		while(i>=229)
		{
			if(i%2!=0)
			{
				System.out.println(i);
				
			}
			i--;
			
		}

	}

}
